tables.table_schema:
CREATE TABLE partnerships (
    id SERIAL PRIMARY KEY,
    influencer_id INT,
    brand_name VARCHAR(50),
    partnership_date DATE
);

CREATE TABLE earnings (
    id SERIAL PRIMARY KEY,
    influencer_id INT,
    earnings_amount DECIMAL(10, 2),
    payment_date DATE
);

CREATE TABLE performance_metrics (
    id SERIAL PRIMARY KEY,
    influencer_id INT,
    followers_count INT,
    engagement_rate DECIMAL(5, 2)
);

CREATE TABLE Earnings (
    earning_id UUID PRIMARY KEY,
    influencer_id UUID,
    earnings DECIMAL
);

CREATE TABLE PerformanceMetrics (
    metric_id UUID PRIMARY KEY,
    influencer_id UUID,
    followers_count INT,
    engagement_rate DECIMAL
);

CREATE TABLE Influencers (
    influencer_id UUID PRIMARY KEY,
    influencer_name VARCHAR,
    influencer_type VARCHAR
);

CREATE TABLE influencers (
    influencer_id INT NOT NULL,
    influencer_name VARCHAR(50) NOT NULL,
    email VARCHAR(100) NOT NULL,
    PRIMARY KEY (influencer_id)
);

CREATE TABLE brands (
    brand_id INT NOT NULL,
    brand_name VARCHAR(50) NOT NULL,
    industry VARCHAR(50) NOT NULL,
    PRIMARY KEY (brand_id)
);
